function DC() {
  return (
    <div>
  <Card sx={{ minWidth: 900,height:500 }}>
      <CardContent>
      <div className='Profile-content'>
        <h1>Profile</h1>
        <Snackbar
        open={open}
        autoHideDuration={6000}
        onClose={handleClose}
        message="Note archived"
        action={action}
      />
        <img src={DCSir} />
        <h5>প্রতিষ্ঠাতা স্কুল অব কুমিল্লা রোবোটিক্স</h5>
      </div>

      </CardContent>
    </Card>
    </div>
  )
}

export default DC
